func summarizeToolCallForUser(toolName string, args map[string]any) string {
	switch toolName {
	case "read":
		path := argString(args, "path")
		start, hasStart := argInt(args, "start_line")
		end, hasEnd := argInt(args, "end_line")
		if hasStart || hasEnd {
			if !hasStart {
