			}
			if !hasEnd {
				end = start
			}
			return fmt.Sprintf("%s %d-%d ", fallbackText(path, "."), start, end)
		}
		return fmt.Sprintf("%s", fallbackText(path, "."))
	case "grep":
		query := argString(args, "query")
		path := argString(args, "path")
		return fmt.Sprintf("%s%s", fallbackText(query, "<empty>"), fallbackText(path, "."))
	case "glob":
		pattern := argString(args, "pattern")
		path := argString(args, "path")
		return fmt.Sprintf("%s%s", fallbackText(pattern, "*"), fallbackText(path, "."))
	case "list":
		path := argString(args, "path")
		return fmt.Sprintf("%s", fallbackText(path, "."))
	case "edit":
		path := argString(args, "path")
		return fmt.Sprintf("%s", fallbackText(path, "."))
	case "patch":
		path := argString(args, "path")
		return fmt.Sprintf("%s", fallbackText(path, "."))
	case "bash":
		cmd := clip(argString(args, "cmd"), 120)
		cwd := argString(args, "cwd")
		if strings.TrimSpace(cwd) == "" {
			cwd = "."
		}
		return fmt.Sprintf("%s%s", fallbackText(cmd, "<empty>"), cwd)
	case "webfetch":
		url := argString(args, "url")
		return fmt.Sprintf("%s", fallbackText(url, "<empty>"))
	case "websearch":
		query := argString(args, "query")
		return fmt.Sprintf("%s", fallbackText(query, "<empty>"))
	default:
		if path := argString(args, "path"); strings.TrimSpace(path) != "" {
			return fmt.Sprintf("%s%s", toolName, path)
		}
		return fmt.Sprintf("%s", toolName)
	}
}

