package llm

import "context"

type ChatMessage struct {
	Role    string `json:"role"`
	Content string `json:"content"`
}

type ChatRequest struct {
	Model          string
	Messages       []ChatMessage
	Temperature    float64
	MaxTokens      int
	Stream         *bool
	EnableThinking *bool
	ClearThinking  *bool
}

type ChatResponse struct {
	Content      string
	Reasoning    string
	FinishReason string
}

type StreamEvent struct {
	Type string
	Text string
}

type Stream interface {
	Recv() (*StreamEvent, error)
	Close() error
}

type Provider interface {
	Chat(ctx context.Context, req ChatRequest) (ChatResponse, error)
	ChatStream(ctx context.Context, req ChatRequest) (Stream, error)
}

type StreamDelta struct {
	Content   string
	Reasoning string
}

type StreamHandler func(delta StreamDelta)

type streamHandlerContextKey struct{}

func WithStreamHandler(ctx context.Context, handler StreamHandler) context.Context {
	if handler == nil {
		return ctx
	}
	return context.WithValue(ctx, streamHandlerContextKey{}, handler)
}

func streamHandlerFromContext(ctx context.Context) StreamHandler {
	if ctx == nil {
		return nil
	}
	v := ctx.Value(streamHandlerContextKey{})
	h, _ := v.(StreamHandler)
	return h
}

package permission

import (
	"path"
	"strings"
)

type Decision string

const (
	DecisionAllow Decision = "allow"
	DecisionAsk   Decision = "ask"
	DecisionDeny  Decision = "deny"
)

type Engine struct {
	defaultDecision Decision
}

func NewEngine(defaultDecision Decision) *Engine {
	if defaultDecision == "" {
		defaultDecision = DecisionAsk
	}
	return &Engine{defaultDecision: defaultDecision}
}

// Decide applies priority: exact > wildcard > default.
func (e *Engine) Decide(toolName string, rules map[string]string) (decision Decision, matched string) {
	toolName = strings.ToLower(strings.TrimSpace(toolName))
	if toolName == "" {
		return DecisionDeny, ""
	}

	if len(rules) == 0 {
		return e.defaultDecision, "default"
	}

	if v, ok := rules[toolName]; ok {
		return normalizeDecision(v, e.defaultDecision), toolName
	}

	for pattern, v := range rules {
		p := strings.ToLower(strings.TrimSpace(pattern))
		if p == "" || p == toolName {
			continue
		}
		if p == "*" {
			continue
		}
		if ok, _ := path.Match(p, toolName); ok {
			return normalizeDecision(v, e.defaultDecision), p
		}
	}

	if v, ok := rules["*"]; ok {
		return normalizeDecision(v, e.defaultDecision), "*"
	}

	return e.defaultDecision, "default"
}

func normalizeDecision(v string, fallback Decision) Decision {
	switch strings.ToLower(strings.TrimSpace(v)) {
	case "allow":
		return DecisionAllow
	case "deny":
		return DecisionDeny
	case "ask":
		return DecisionAsk
	default:
		return fallback
	}
}

package permission

import "testing"

func TestDecidePriority(t *testing.T) {
	e := NewEngine(DecisionAsk)
	rules := map[string]string{
		"*":      "deny",
		"read":   "allow",
		"mcp:*":  "ask",
		"mcp:fs": "allow",
	}

	dec, matched := e.Decide("read", rules)
	if dec != DecisionAllow || matched != "read" {
		t.Fatalf("expected exact allow, got %s matched=%s", dec, matched)
	}

	dec, matched = e.Decide("mcp:git", rules)
	if dec != DecisionAsk || matched != "mcp:*" {
		t.Fatalf("expected wildcard ask, got %s matched=%s", dec, matched)
	}

	dec, matched = e.Decide("unknown", rules)
	if dec != DecisionDeny || matched != "*" {
		t.Fatalf("expected fallback deny, got %s matched=%s", dec, matched)
	}
}

