Camera::Camera(glm::vec3 pos, glm::vec3 up, float yaw, float pitch)
 : m_position(pos), m_worldUp(up), m_yaw(yaw), m_pitch(pitch)
 , m_front(0,0,-1), m_movementSpeed(PLAYER_SPEED), m_mouseSensitivity(MOUSE_SENSITIVITY), m_zoom(FOV) {
 updateCameraVectors();
}

glm::mat4 Camera::getViewMatrix() const {
 return glm::lookAt(m_position, m_position + m_front, m_up);
}

glm::mat4 Camera::getProjectionMatrix(float aspect, float fov, float nearP, float farP) const {
 return glm::perspective(glm::radians(fov), aspect, nearP, farP);
}

void Camera::processKeyboard(CameraMovement dir, float dt, bool sprint) {
 float vel = m_movementSpeed * dt;
 if(sprint) vel *= PLAYER_SPRINT_MULTIPLIER;
 if(dir == CameraMovement::FORWARD) m_position += m_front * vel;
 if(dir == CameraMovement::BACKWARD) m_position -= m_front * vel;
 if(dir == CameraMovement::LEFT) m_position -= m_right * vel;
 if(dir == CameraMovement::RIGHT) m_position += m_right * vel;
}

void Camera::processMouseMovement(float xoff, float yoff, bool constrain) {
 xoff *= m_mouseSensitivity;
 yoff *= m_mouseSensitivity;
 m_yaw += xoff;
 m_pitch += yoff;
 if(constrain) {
 if(m_pitch > 89.0f) m_pitch = 89.0f;
 if(m_pitch < -89.0f) m_pitch = -89.0f;
 }
 updateCameraVectors();
}

void Camera::processMouseScroll(float yoff) {
 m_zoom -= yoff;
 if(m_zoom < 1.0f) m_zoom = 1.0f;
 if(m_zoom > 90.0f) m_zoom = 90.0f;
}

void Camera::setPosition(const glm::vec3& pos) { m_position = pos; }

void Camera::setRotation(float yaw, float pitch) {
 m_yaw = yaw; m_pitch = pitch;
 updateCameraVectors();
}

void Camera::updateCameraVectors() {
 glm::vec3 f;
 f.x = cos(glm::radians(m_yaw)) * cos(glm::radians(m_pitch));
 f.y = sin(glm::radians(m_pitch));
 f.z = sin(glm::radians(m_yaw)) * cos(glm::radians(m_pitch));
 m_front = glm::normalize(f);
 m_right = glm::normalize(glm::cross(m_front, m_worldUp));
 m_up = glm::normalize(glm::cross(m_right, m_front));
}

