Enemy::Enemy() : m_physics(nullptr), m_body(nullptr), m_state(EnemyState::IDLE)
 , m_health(ENEMY_MAX_HEALTH), m_speed(ENEMY_SPEED), m_detectionRange(ENEMY_DETECTION_RANGE)
 , m_attackRange(ENEMY_ATTACK_RANGE), m_attackCooldown(ENEMY_ATTACK_COOLDOWN), m_attackTimer(0) {
 std::random_device rd;
 m_rng.seed(rd());
}

void Enemy::initialize(PhysicsWorld* physics, const glm::vec3& pos) {
 m_physics = physics;
 m_body = physics->createCapsule(pos, ENEMY_RADIUS, ENEMY_HEIGHT, ENEMY_MASS);
 m_body->setAngularFactor(0);
 m_body->setActivationState(DISABLE_DEACTIVATION);
 m_position = pos;
 m_patrolTarget = pos + glm::vec3((rand() % 10 - 5), 0, (rand() % 10 - 5));
}

void Enemy::update(float dt, const glm::vec3& playerPos) {
 if(m_state == EnemyState::DEAD) return;
 m_position = m_physics->getPosition(m_body);
 updateAI(dt, playerPos);
 m_attackTimer -= dt;
}

void Enemy::updateAI(float dt, const glm::vec3& playerPos) {
 float dist = glm::length(playerPos - m_position);

 if(dist < m_attackRange && m_attackTimer <= 0) {
 m_state = EnemyState::ATTACK;
 attack();
 m_attackTimer = m_attackCooldown;
 } else if(dist < m_detectionRange) {
 m_state = EnemyState::CHASE;
 moveTowards(playerPos, m_speed * 1.5f);
 } else {
 m_state = EnemyState::PATROL;
 if(glm::length(m_patrolTarget - m_position) < 1.0f) {
 std::uniform_real_distribution<float> d(-10, 10);
 m_patrolTarget = m_position + glm::vec3(d(m_rng), 0, d(m_rng));
 }
 moveTowards(m_patrolTarget, m_speed);
 }
}

void Enemy::moveTowards(const glm::vec3& target, float speed) {
 glm::vec3 dir = target - m_position;
 dir.y = 0;
 if(glm::length(dir) > 0.1f) {
 dir = glm::normalize(dir) * speed;
 m_physics->setVelocity(m_body, glm::vec3(dir.x, m_physics->getPosition(m_body).y, dir.z));
 }
}

void Enemy::attack() {
 // Attack logic - could emit event or directly damage player
}

void Enemy::takeDamage(float dmg) {
 m_health -= dmg;
 if(m_health <= 0) die();
}

void Enemy::die() {
 m_state = EnemyState::DEAD;
 m_physics->removeBody(m_body);
}

glm::vec3 Enemy::getPosition() const {
 return m_physics ? m_physics->getPosition(m_body) : glm::vec3(0);
}

