void ParticleSystem::emit(const glm::vec3& pos, const glm::vec3& dir, int count, const glm::vec4& color, float speed, float life) {
 std::uniform_real_distribution<float> d(-0.5f, 0.5f);
 for(int i=0; i<count; i++) {
 size_t idx = findUnused();
 m_particles[idx].position = pos;
 m_particles[idx].velocity = dir * speed + glm::vec3(d(m_rng), d(m_rng), d(m_rng));
 m_particles[idx].color = color;
 m_particles[idx].life = life;
 m_particles[idx].maxLife = life;
 m_particles[idx].active = true;
 }
}

void ParticleSystem::update(float dt) {
 for(auto& p : m_particles) {
 if(!p.active) continue;
 p.life -= dt;
 if(p.life <= 0) { p.active = false; continue; }
 p.position += p.velocity * dt;
 p.velocity *= 0.98f;
 }
}

