size_t ParticleSystem::findUnused() {
 for(size_t i=m_lastUsed; i<m_max; i++) if(!m_particles[i].active) { m_lastUsed = i; return i; }
 for(size_t i=0; i<m_lastUsed; i++) if(!m_particles[i].active) { m_lastUsed = i; return i; }
 return 0;
}

