void PhysicsWorld::initialize() {
 m_collisionConfig = std::make_unique<btDefaultCollisionConfiguration>();
 m_dispatcher = std::make_unique<btCollisionDispatcher>(m_collisionConfig.get());
 m_broadphase = std::make_unique<btDbvtBroadphase>();
 m_solver = std::make_unique<btSequentialImpulseConstraintSolver>();
 m_world = std::make_unique<btDiscreteDynamicsWorld>(m_dispatcher.get(), m_broadphase.get(), m_solver.get(), m_collisionConfig.get());
 m_world->setGravity(btVector3(0, GRAVITY, 0));
}

void PhysicsWorld::update(float dt) {
 if(m_world) m_world->stepSimulation(dt, 10);
}

void PhysicsWorld::cleanup() {
 for(auto* body : m_bodies) {
 if(body && m_world) {
 m_world->removeRigidBody(body);
 delete body->getMotionState();
 delete body;
 }
 }
 m_bodies.clear();
 m_motionStates.clear();
 m_shapes.clear();
 m_world.reset();
 m_solver.reset();
 m_broadphase.reset();
 m_dispatcher.reset();
 m_collisionConfig.reset();
}

btRigidBody* PhysicsWorld::createBox(const glm::vec3& pos, const glm::vec3& halfSize, float mass) {
 auto* shape = new btBoxShape(btVector3(halfSize.x, halfSize.y, halfSize.z));
 m_shapes.emplace_back(shape);
 btTransform t; t.setIdentity(); t.setOrigin(btVector3(pos.x, pos.y, pos.z));
 btVector3 inertia(0,0,0);
 if(mass > 0) shape->calculateLocalInertia(mass, inertia);
 auto* motion = new btDefaultMotionState(t);
 m_motionStates.emplace_back(motion);
 btRigidBody::btRigidBodyConstructionInfo info(mass, motion, shape, inertia);
 auto* body = new btRigidBody(info);
 m_bodies.push_back(body);
 if(m_world) m_world->addRigidBody(body);
 return body;
}

btRigidBody* PhysicsWorld::createSphere(const glm::vec3& pos, float radius, float mass) {
 auto* shape = new btSphereShape(radius);
 m_shapes.emplace_back(shape);
 btTransform t; t.setIdentity(); t.setOrigin(btVector3(pos.x, pos.y, pos.z));
 btVector3 inertia(0,0,0);
 if(mass > 0) shape->calculateLocalInertia(mass, inertia);
 auto* motion = new btDefaultMotionState(t);
 m_motionStates.emplace_back(motion);
 btRigidBody::btRigidBodyConstructionInfo info(mass, motion, shape, inertia);
 auto* body = new btRigidBody(info);
 m_bodies.push_back(body);
 if(m_world) m_world->addRigidBody(body);
 return body;
}

