Player::Player() : m_physics(nullptr), m_body(nullptr), m_health(PLAYER_MAX_HEALTH)
 , m_height(PLAYER_HEIGHT), m_radius(PLAYER_RADIUS), m_grounded(false) {}

void Player::initialize(PhysicsWorld* physics) {
 m_physics = physics;
 m_body = physics->createCapsule(glm::vec3(0, m_height/2, 0), m_radius, m_height, PLAYER_MASS);
 m_body->setAngularFactor(0);
 m_body->setActivationState(DISABLE_DEACTIVATION);
 m_camera.setPosition(glm::vec3(0, m_height, 0));
}

void Player::update(float) {
 m_position = m_physics->getPosition(m_body);
 m_camera.setPosition(m_position + glm::vec3(0, m_height/2 + 0.1f, 0));
 updateGroundedState();
}

void Player::processInput(bool fwd, bool back, bool left, bool right, bool jump, bool sprint) {
 glm::vec3 moveDir(0);
 glm::vec3 camFront = m_camera.getFront();
 camFront.y = 0; camFront = glm::normalize(camFront);
 glm::vec3 camRight = m_camera.getRight();
 camRight.y = 0; camRight = glm::normalize(camRight);
 if(fwd) moveDir += camFront;
 if(back) moveDir -= camFront;
 if(left) moveDir -= camRight;
 if(right) moveDir += camRight;
 if(glm::length(moveDir) > 0) {
 moveDir = glm::normalize(moveDir);
 float speed = PLAYER_SPEED;
 if(sprint) speed *= PLAYER_SPRINT_MULTIPLIER;
 m_physics->setVelocity(m_body, moveDir * speed + glm::vec3(0, m_grounded ? 0 : m_physics->getPosition(m_body).y, 0));
 }
 if(jump && m_grounded) {
 m_physics->applyImpulse(m_body, glm::vec3(0, PLAYER_JUMP_FORCE * PLAYER_MASS, 0));
 m_grounded = false;
 }
}

void Player::look(float xoff, float yoff) {
 m_camera.processMouseMovement(xoff, yoff);
}

void Player::takeDamage(float dmg) { m_health -= dmg; if(m_health < 0) m_health = 0; }
void Player::heal(float amt) { m_health += amt; if(m_health > PLAYER_MAX_HEALTH) m_health = PLAYER_MAX_HEALTH; }

glm::vec3 Player::getVelocity() const {
 if(!m_body) return glm::vec3(0);
 btVector3 v = m_body->getLinearVelocity();
 return glm::vec3(v.x(), v.y(), v.z());
}

void Player::updateGroundedState() {
 RaycastResult result;
 glm::vec3 pos = m_position + glm::vec3(0, 0.1f, 0);
 m_grounded = m_physics->raycast(pos, pos - glm::vec3(0, m_height/2 + 0.2f, 0), result);
}

