Weapon::Weapon() : m_physics(nullptr), m_currentAmmo(WEAPON_MAGAZINE_SIZE)
 , m_magazineSize(WEAPON_MAGAZINE_SIZE), m_cooldown(0), m_fireRate(WEAPON_COOLDOWN)
 , m_damage(WEAPON_DAMAGE), m_reloading(false), m_reloadTime(WEAPON_RELOAD_TIME), m_reloadTimer(0) {}

void Weapon::initialize(PhysicsWorld* physics) { m_physics = physics; }

void Weapon::update(float dt) {
 if(m_cooldown > 0) m_cooldown -= dt;
 if(m_reloading) {
 m_reloadTimer -= dt;
 if(m_reloadTimer <= 0) {
 m_currentAmmo = m_magazineSize;
 m_reloading = false;
 }
 }
 for(auto& b : m_bullets) b.update(dt);
 removeDeadBullets();
}

bool Weapon::fire(const glm::vec3& pos, const glm::vec3& dir) {
 if(m_reloading || m_cooldown > 0 || m_currentAmmo <= 0) return false;
 Bullet b;
 b.initialize(m_physics, pos, dir, BULLET_SPEED, m_damage);
 m_bullets.push_back(std::move(b));
 m_currentAmmo--;
 m_cooldown = m_fireRate;
 if(m_currentAmmo == 0) reload();
 return true;
}

void Weapon::reload() {
 if(m_reloading || m_currentAmmo == m_magazineSize) return;
 m_reloading = true;
 m_reloadTimer = m_reloadTime;
}

float Weapon::getReloadProgress() const {
 if(!m_reloading) return 1.0f;
 return 1.0f - (m_reloadTimer / m_reloadTime);
}

void Weapon::removeDeadBullets() {
 m_bullets.erase(std::remove_if(m_bullets.begin(), m_bullets.end(), [](const Bullet& b){ return !b.isAlive(); }), m_bullets.end());
}

